import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import classNames from "classnames";
import Button from "@material-ui/core/Button";
import AddIcon from "@material-ui/icons/Add";
import { BrowserRouter, Switch, Link, Route } from "react-router-dom";
import TitleBarMemberDet from "./titleBarMemberDetails";
import MemberPanelTabs from "./memberPanelTabs";

const styles = theme => ({
  root: {
    paddingTop: theme.spacing(2),
    paddingBottom: theme.spacing(2),
    marginTop: theme.spacing(5),
    marginLeft: theme.spacing(65),
    align: "center",
    width: "19.5%"
  },
  button: {
    margin: theme.spacing.unit
  },
  leftIcon: {
    marginRight: theme.spacing.unit
  },
  rightIcon: {
    marginLeft: theme.spacing.unit
  },
  iconSmall: {
    fontSize: 20
  },
  container: {
    display: "flex",
    flexWrap: "wrap"
  }
});

const navStyle = {
  color: "black",
  textDecoration: "none"
};

class teamMemberActions extends React.Component {
  render() {
    const { classes } = this.props;

    return (
      <BrowserRouter>
        <div>
          <Paper className={classes.root} elevation={7}>
            <Link style={navStyle} to="/teammembers/newmember">
              <Button
                variant="contained"
                className={classes.button}
                //onClick={this.handleClickOpen}
              >
                <AddIcon
                  className={classNames(classes.leftIcon, classes.iconSmall)}
                />
                Add New
              </Button>
            </Link>
          </Paper>
        </div>
      </BrowserRouter>
    );
  }
}

teamMemberActions.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(teamMemberActions);
